import { StyleSheet, Text, View } from 'react-native'
import React from 'react'
import { BrowserRouter as Router, Link, Route, Switch } from 'react-router-dom';

const Rutas = () => {
  return (
    <div>
        <nav>
            <h1>Rutas</h1>
            <Link to='/'>Inicio</Link>
            <Link to='/contacto'>Contacto</Link>
        </nav>
    </div>
    )
}

export default Rutas
